        <>
       <div className="container">
        <section className="text-section center">
            <span>Welcome to my Blog page</span>
            <p>start blogging</p>
            <NavLink to="/Blogs">get started</NavLink>
        </section>
         
       </div> 
        </>
    )
}
export default Home;
